import { Link } from "react-router-dom";
import "../App.css";

function Home() {
  return (
    <>
      {/* HERO SECTION */}
      <section className="hero">
        <section className="hero2">
             <div className="hero-content">
          <h1>Book Your Appointment Easily</h1>
          <p>
            Schedule appointments anytime, anywhere with trusted professionals.
          </p>
          <Link to="/BookAppointment" className="btn-primary">
            Book Appointment
          </Link>
        </div>
        </section>
      </section>

      </>
      );
}

export default Home;
